import './App.css';
import './Navbar.css';
import './Header.css';
import './Credits.css';
import Navbar from './Navbar.js';
import Header from './Header.js';
import AboutMe from './AboutMe';
import Credits from './Credits';

function App() {
  return (
    <>
      <Header />
      <Navbar />
      <AboutMe />
      <Credits />
    </>
  );
}

export default App;
